import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider } from './context/ThemeContext';
import Layout from './components/Layout/Layout';
import Dashboard from './pages/Dashboard';
import EventsAnalysis from './pages/EventsAnalysis';
import ChangePointAnalysis from './pages/ChangePointAnalysis';
import CorrelationAnalysis from './pages/CorrelationAnalysis';
import Insights from './pages/Insights';
import './styles/App.css';

function App() {
  return (
    <ThemeProvider>
      <Router>
        <Layout>
          <Routes>
            <Route path="/" element={<Navigate to="/dashboard" replace />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/events" element={<EventsAnalysis />} />
            <Route path="/changepoint" element={<ChangePointAnalysis />} />
            <Route path="/correlation" element={<CorrelationAnalysis />} />
            <Route path="/insights" element={<Insights />} />
          </Routes>
        </Layout>
      </Router>
    </ThemeProvider>
  );
}

export default App;
